import React, { Component } from 'react'

export class LifeCyclesCDM extends Component {
    constructor(props) {
        console.log('constructor called')
      super(props)

      this.state = {
         data: 'loading'
      }
    }
    getData() {
        console.log('getData(')
        setTimeout(() =>  {
            this.setState({
                data: 'loaded'
            })
        }, 3000)
    }
    componentDidMount() {
        this.getData()
    }
  render() {
    return (
      <div>
        <h1>{this.state.data}</h1>
      </div>
    )
  }
}

export default LifeCyclesCDM
